query TemplateBlogPostsPaginationQuery(
  $afterPost: String
  $firstPost: Int
  $path: String
) {
  ...TemplateBlogPostsPaginationFragment
}

fragment TemplateBlogPostsPaginationFragment on Query {
  pages {
    resolve(path: $path) {
      template {
        __typename
        ... on TemplateBlogPage {
          posts(first: $firstPost, after: $afterPost, orderBy: [{field: PUBLISHED_AT, direction: ASC}]) {
            edges {
              node {
                id
                publishedAt
                page {
                  id
                  path
                  name
                  template {
                    __typename
                    ... on TemplateBlogPostPage {
                      image {
                        file {
                          preview: transform(input: [{cover: {w: 100, h: 100}}, {format: {type: WEBP, quality: 25}}]) {
                            url
                            id
                          }
                          id
                        }
                        id
                      }
                      id
                    }
                    ... on TemplateBlogPage {
                      id
                    }
                    ... on TemplateFallbackPage {
                      id
                    }
                    ... on TemplateHomePage {
                      id
                    }
                    ... on TemplateSecondPage {
                      id
                    }
                  }
                }
                __typename
              }
              cursor
            }
            pageInfo {
              endCursor
              hasNextPage
            }
          }
          id
        }
        ... on TemplateBlogPostPage {
          id
        }
        ... on TemplateFallbackPage {
          id
        }
        ... on TemplateHomePage {
          id
        }
        ... on TemplateSecondPage {
          id
        }
      }
      id
    }
  }
}

