mutation AuthFormCreateTokenMutation(
  $login: String!
  $password: String!
) {
  authentification {
    create(login: $login, password: $password) {
      __typename
      ... on TokenRegistrationSuccess {
        payload {
          accessToken {
            token
            payload {
              id
              uuid
              exp
              iss
              roles
              type
            }
          }
          refreshToken {
            token
            payload {
              id
              uuid
              exp
              iss
              type
            }
          }
        }
      }
      ... on TokenRegistrationError {
        name
        msg
      }
    }
  }
}

