  $isDesktop: Boolean!
  $firstPost: Int
  $afterPost: String
  $isBlog: Boolean!
) {
  ...TemplateBlogPostsPaginationFragment
  pages {
    resolve(path: $path) {
      id
      statusCode
      template {
        __typename
        ... on TemplateBlogPage {
          id
        }
        ... on TemplateBlogPostPage {
          id
        }
        ... on TemplateFallbackPage {
          id
        }
        ... on TemplateHomePage {
          id
        }
        ... on TemplateSecondPage {
          id
        }
      }
      ...TemplateHomeDesktopFragment @include(if: $isDesktop)
      ...TemplateHomeMobileFragment @skip(if: $isDesktop)
      ...TemplateFallbackDesktopFragment
      ...TemplateSecondDesktopFragment
      ...TemplateBlogPostDesktopFragment @include(if: $isBlog)
      ...TemplateBlogDesktopFragment @include(if: $isBlog)
    }
  }
}

fragment ContentBlockFragment on ContentBlock {
  __isContentBlock: __typename
  __typename
  ... on ContentBlockPlainText {
    ...ContentBlockPlainTextFragment
  }
  ... on ContentBlockLexical {
    ...ContentBlockLexicalFragment
  }
  ... on ContentBlockImage {
    ...ContentBlockImageFragment
  }
}

fragment ContentBlockImageFragment on ContentBlockImage {
  id
  alt
  title
  file {
    url
    transform(input: [{contain: {w: 160, h: 160}}]) {
      url
      id
    }
    id
  }
}

fragment ContentBlockLexicalFragment on ContentBlockLexical {
  id
  lexical
}

fragment ContentBlockPlainTextFragment on ContentBlockPlainText {
  id
  text
}

fragment MainSliderBlockFragment on Slider {
  slides {
    id
    ...SlideFragment
  }
}

fragment PaymentsBlockFragment on Payments {
  title {
    __typename
    ...ContentBlockFragment
    id
  }
  subtitle {
    __typename
    ...ContentBlockFragment
    id
  }
  content {
    __typename
    ...ContentBlockFragment
    id
  }
  icons {
    id
    color
  }
}

fragment SlideFragment on Slide {
  id
  image {
    __typename
    id
    alt
    title
    file {
      url
      image: transform(input: [{cover: {w: 1102, h: 620}}, {format: {type: WEBP, quality: 80}}]) {
        url
        id
